import React from 'react';
import './Contact.css'; 

const Contact = () => {
  return (
    <section id="contact" className="contact-section">
      <h1>Let's Connect.</h1>
      <div class="social-grid">
        <a href="https://www.linkedin.com/in/nadia-shovkovy" target="_blank" class="social-link linkedin">LinkedIn</a>
        <a href="https://medium.com/@nadiashovkovy" target="_blank" class="social-link medium">Medium</a>
        <a href="https://github.com/nadiashovkovy" target="_blank" class="social-link github">GitHub</a>
        <a href="https://app.joinhandshake.com/nadiashovkovy" target="_blank" class="social-link handshake">Handshake</a>
      </div>
    </section>
  );
}

export default Contact;
